import React from 'react';
import './App.css';

import PlayerSection from './PlayerSection/PlayerSection'
import PlaylistSection from './PlaylistSection/PlaylistSection'

function App() {
  return (
    <div className='App'>
        <div className='left'>
            <PlayerSection />
        </div>
        <div className='right'>
            <PlaylistSection className='right'/>
        </div>


    </div>
  )
}

export default App;
